import React from 'react';
import { Parallax } from 'react-scroll-parallax'

function Header() {
    return (
        <div>
            <header>
                <Parallax className="custom-class" x={[-20, 20]} tagOuter="figure">
                    <span>
                        <h1>Ernest</h1>
                        <h1>Ho</h1>
                    </span>
                </Parallax>
            </header>
        </div>
    );
}

export default Header;
